            mapInit: () => {
                /* Si esta inicializado el mapa se los vuelve null, con funciones de Leaftlet*/
                let contenedorMapa = L.DomUtil.get('xpm_map_c');
                // console.log(contenedorMapa)
                // console.log(contenedorMapa._leaflet_id)
                // if (contenedorMapa != null) {
                //     contenedorMapa._leaflet_id = null; 
                //     console.log('adentro')
                // }
                
                xpmcC.map =  L.map('xpm_map_c', {dragging:true,scrollWheelZoom: false} );
                // L.tileLayer('https://cartodb-basemaps-{s}.global.ssl.fastly.net/light_all/{z}/{x}/{y}.png', {
                L.tileLayer('http://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png', {
                // L.tileLayer('https://api.mapbox.com/styles/v1/{id}/tiles/{z}/{x}/{y}?access_token={accessToken}', {
                    attribution: '',
                    maxZoom: 18,
                    minZoom: 3
                }).addTo(xpmcC.map);
                L.control.scale().addTo(xpmcC.map);
                // xpmcC.map.dragging.enable();
            },
            showmap: () => {
                /* quita las unidades de escala que se repiten REVISAR */
                $(`${xpmcC.wrapper} .leaflet-control-scale leaflet-control`).remove();
                let deptoSel = $(`${xpmcC.wrapper} [__xpm_select_deptos]`).val();
                let zoom = deptoSel == '_' ? 5 : 14; 
                let coordIni = dataLocaliza_c('coord_departamentos');          
              
                xpmcC.map.setView(coordIni[deptoSel],  zoom);     
                // xpmcC.map.dragging.enable();        
            },    
            putMarkers: () => {
                let markers = 
                {
                    centrosalud: L.AwesomeMarkers.icon({
                                    icon: 'x fas fa-hospital-symbol fa-lg',
                                    prefix: '',
                                    markerColor: 'darkred',
                                    iconColor: 'white'
                                }),
                    policia: L.AwesomeMarkers.icon({
                                    icon: 'x fas fa-user-shield fa-lg',
                                    prefix: '',
                                    markerColor: 'darkgreen',
                                    iconColor: 'white'
                                }),
                    institucion: L.AwesomeMarkers.icon({
                                    icon: 'x fas fa-university fa-lg',
                                    prefix: '',
                                    markerColor: 'darkblue',
                                    iconColor: 'white'
                                })
                }

                let categorias = $(`${xpmcC.wrapper} .categoria_seleccionada` );
                _.forEach(categorias, (el) => {
                    let cat = $(el).attr("__categoria");
                    cat = cat.split('_');
                    let categoria = cat[0];
                    let catData = dataLocaliza_c(cat[0]);
                    let deptoSel = $(`${xpmcC.wrapper} [__xpm_select_deptos]`).val();

                    let dataMap = cat.length == 1 ? _.filter(catData, (x) => {
                                                        return x.properties.departamen == deptoSel;
                                                    }) : 
                                                    _.filter(catData, (x) => {
                                                        return x.properties.DEPARTAMEN == deptoSel;
                                                    }) ;
                                    
                    // console.log(dataMap.length)
                    // let  catSplit = cat.split('_');
                    if(cat.length > 1){
                        let  nivel = cat[1];
                        if(nivel == '1')
                            dataMap = _.filter(dataMap, (x) =>{
                                return x.properties.NIVELRES == "1er NIVEL"
                            })
                        if(nivel == '2')
                            dataMap = _.filter(dataMap, (x) =>{
                                return x.properties.NIVELRES == "2do NIVEL"
                            })
                        if(nivel == '3')
                            dataMap = _.filter(dataMap, (x) =>{
                                return x.properties.NIVELRES == "3er NIVEL"
                            })
                    }

                    _.forEach(dataMap, (item) => {
                        let coords = item.geometry.coordinates;
                        if(cat.length > 1){
                            let m = L.marker([coords[1], coords[0]], { icon: markers[categoria] }).addTo(xpmcC.map);
                            m.bindPopup(`<b>${item.properties.ESTSALUD} </b>  
                            <br>  ${item.properties.NIVELRES} 
                            <br><br><em>Subsector: ${item.properties.SUBSECTOR}</em> `);
                        }
                        else{
                            let m = L.marker([coords[1], coords[0]], { icon: markers[categoria] }).addTo(xpmcC.map);
                            m.bindPopup(`<b>${item.properties.institucio} </b>
                            <br><br><em> ${item.properties.Info}</em> `);
                        }
                    });
                    
                })

                // console.log(xpmcC.datalocaliza_c('defensorias'));
                
                // let defensorias = xpmcC.datalocaliza_c('defensorias');
                // defensorias_new = _.filter(defensorias, (x) => {
                //                         return x.properties.departamen;// == 'La Paz';
                //                     });
                // _.forEach(defensorias, (item) => {
                //     let coords = item.geometry.coordinates;
                //     m = new L.marker([coords[1], coords[0]], { icon: markers.institucion })
                //         .bindPopup(`<b>${item.properties.institucio} </b>
                //         <br><br><em> ${item.properties.Info}</em> `).addTo(xpmcC.map);
                // });



            },
            
        }

        let xpmListeners_c = () => {
            $("[__xpm_c]")
            .on('change',"[__xpm_select_deptos]", () => {
                $(".awesome-marker").remove();
                // $(".leaflet-popup-pane").remove();
                xpmcC.showmap();
                xpmcC.putMarkers();
            })
            .on('click', "[__categoria]", (e)=>{
                $(".awesome-marker").remove();
                // $(".leaflet-popup-pane").remove();
                let cate = $(e.currentTarget).attr("__categoria");
                // console.log(cate);
                $(e.currentTarget).hasClass("categoria_seleccionada") ? $(e.currentTarget).removeClass("categoria_seleccionada") : $(e.currentTarget).addClass("categoria_seleccionada");
                xpmcC.putMarkers();
            })


           
        }

        let xpmInit = (() => {
            // console.log('geo' + Date.now())
            xpmListeners_c();
            xpmcC.mapInit();
            xpmcC.showmap();
            
